// import styled from 'styled-components'
import images from './'
import { Gallery, GalleryImage } from 'react-gesture-gallery'



export const Slider = () => {
  return(
    <Gallery index={0}>
      {images.map(img => (
        <GalleryImage src={img.url} />
      ))}

    </Gallery>
  )
};
